import web from './images/web-development.png';
import app from './images/app-development.jpg';
import software from './images/software-development.jpg';
import digital from './images/digital-marketing.jpg';
import android from './images/android-development.jpg';
import marketing from './images/marketing.png';

const Sdata = [
    {
        imgsrc:web,
        title:"Wev Development",
    },
    {
        imgsrc:app,
        title:"App Development",
    },
    {
        imgsrc:software,
        title:"Software Development",
    },
    {
        imgsrc:digital,
        title:"Digital Marketing",
    },
    {
        imgsrc:android,
        title:"Wev Development",
    },
    {
        imgsrc:marketing,
        title:"Marketing",
    },

]

export default Sdata;
